import {
    SRNModel,
    Unit,
    UnitType,
    Check,
    CheckType,
    ServerName
} from '../../src/index';
import {observable} from 'mobx';

class CarModel extends SRNModel {
    /**
     * 价格
     * @type {number}
     */
    @Unit(UnitType.PRICE_UNIT_F)
    price = 0;
    /**
     * 里程
     * @type {number}
     */
    @Unit(UnitType.MILEAGE_UNIT_KM)
    distance = 0;
    /**
     * 名字
     * @type {string}
     */
    @Check(CheckType.Object)
    name = '';
    /**
     * 标题
     * @type {string}
     */
    @ServerName('user_title')
    title = '';
}

export default  CarModel;